function Skills() {
    return (
  <div>
    <FontAwesomeIcon icon="fa-brands fa-js fa-5x" size="5x" />
  <FontAwesomeIcon icon="fa-brands fa-css3-alt" size="5" />
    <FontAwesomeIcon icon="fa-brands fa-node" size="5x" />
    <FontAwesomeIcon icon="fa-brands fa-github" size="5x" />
    <FontAwesomeIcon icon="fa-brands fa-html5" size="5x" />
    <FontAwesomeIcon icon="fa-brands fa-react" size="5x" />
  </div>
)
}
export default Skills
